import React from 'react'

import Alunos from '../../data/alunos'

export default props =>{

    const alunoList = Alunos.map(aluno =>{
        return (
        <li key={aluno.id}>
            {aluno.id} ) {aluno.nome} -> {aluno.nota}
        </li>
        )
    })

    return(
        <div>
            <ul>
                {alunoList}
            </ul>
        </div>
    )

}
